            <ConnectorProvider setId={setId}/>
            <CustomSidebar
                {...customsidebar}
                currentRoute={"#" + location.pathname}
                id={id}
                setId={setId}
                cookie={cookie}
                page={props.page}
            />
            <div className="relative xxl:ml-64 bg-blueGray-100 min-h-screen">
                {(() => {
                    switch (props.page) {
                        case 'specification':
                            return (
                                <Specifications/>
                            )
                        case 'controllers':
                            return (
                                <Controllers/>
                            )
                        case 'synthetise':
                            return (
                                <Synthetise/>
                            )
                        default:
                            return (
                                <LandingPage/>
                            )
                    }
                })()}
            </div>
        </SocketProvider>
    );
}
